import './resume.css';
import React from 'react';
import { Card } from 'react-bootstrap';
import { connect } from 'react-redux';

const Kits = (props) => {

  const createKitCard = (trophies) => {

    return(
      <>
        {trophies.map(function(trophy, index) {
          return (
          <div className="col-lg-4 col-6" key={index}>
              <Card>
                <Card.Img variant="top" src={trophy.link}/>
                <Card.Body>
                  <Card.Title>{trophy.name}</Card.Title>
                  <Card.Text>
                    {trophy.blurb}
                  </Card.Text>
                </Card.Body>
              </Card>
            </div>
          );
        })}
      </>
    )
  }

  return (
    <div className="container">
        <div className="row">
          {createKitCard(props.trophies.accomplishments)}
        </div>
    </div>
  )
}

function mapStateToProps(state){
  const trophies = state.accomplishmentsReducer;
  return {
    trophies: trophies
  }
}

export default  connect(mapStateToProps)(Kits);
